import React from 'react';
import './App.css';
import ExpenseEntryItem from './components/ExpenseEntryItem';
import 'bootstrap/dist/css/bootstrap.min.css';

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      items: [
        { id:1,name:"Mango",price:34,date:"2022-12-12",category:"Food" },
        {id:2,name:"Mango",price:34,date:"2022-12-12",category:"Food"}
      ]
    }
  }
  render() {
    return(
      <div>
        {this.state.items.map(item => (
        <h1>{item.name} </h1>
      ))}
      </div>
    )
  }
}

export default App;
